import base64


class QssDataMgr(object):
  bf = ""

  black = ""

  blue = ""

  darkblack = ""

  darkblue = ""

  darkgray = ""

  flatblack = ""

  flatwhite = ""

  gray = ""

  lightblack = ""

  lightblue = ""

  lightgray = ""

  psblack = ""

  qt_list_scrollbar = ""

  silvery = ""

  test = ""

  files = ['bf', 'black', 'blue', 'darkblack', 'darkblue', 'darkgray', 'flatblack', 'flatwhite', 'gray', 'lightblack', 'lightblue', 'lightgray', 'psblack', 'qt_list_scrollbar', 'silvery', 'test']

  @classmethod
  def GetData(cls, name):
      data = getattr(cls, name)
      return base64.b64decode(data.encode('utf-8')).decode('utf-8')
